css:
.item-count-box {
  float: right;
  min-width: 26px;
  text-align: center;
  display: inline;
  font-size: 12px;
  padding: 1px 5px 1px 5px;
  margin-top: 3.5px;
  line-height: 20.9px;
  border-radius: 3px;
}
.search-bar {
  position: relative;
  order: -100;
  overflow: visible;
  z-index: 100;
  width: 450px;
  margin-top: 10px;
  margin-left: 12px;
  margin-right: 12px;
}
.search-bar .menu .header-container {
  padding: 0;
  height: 30px;
  background-color: transparent;
  border: none;
}
.search-bar .menu .header-container input {
  padding-left: 30px;
  width: 100%;
  height: 30px;
}
.search-bar .menu .header-container input.empty {
  text-align: left;
}
.search-bar .menu .header-container input.empty:focus {
  text-align: left;
}
.search-bar .menu .footer-container {
  border: none;
}
.search-bar .menu .content-container {
  position: absolute;
  z-index: 2;
  width: 100%;
  box-shadow: 0 1px 4px 0 rgba(0, 0, 0, 0.21);
  background-color: #ffffff;
}
.search-bar .menu .content-container .item {
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
}
.search-bar .search-container {
  position: relative;
}
.search-bar .search-container.showing-suggestions .suggestions {
  display: inherit;
}
.search-bar .search-container.showing-suggestions .clear {
  color: #77828d;
  display: inherit;
}
.search-bar .search-container.showing-query .clear {
  display: inherit;
}
.search-bar .search-accessory.search {
  position: absolute;
  top: 12px;
  left: 12px;
}
.search-bar .search-accessory.clear {
  position: absolute;
  top: 4px;
  color: #77828d;
  right: 12px;
  display: none;
}
